import React, { createContext } from 'react';
import {Route, Switch} from 'react-router-dom'
import IndexPage from './pages/IndexPage';
import RankPage from './pages/RankPage';
import useLocalStorage from './utils/useLocalStorage';

// import SignInPage from './pages/accounts/SignInPage';
// import SignUpPage from './pages/accounts/SignUpPage';

const JwtContext = createContext();
const userContext = createContext();

const App = () => {
  const [jwtToken, setJwtToken] = useLocalStorage("jwtToken", "");

  const handleLogOut = () => {
    setJwtToken("")
  }



  return (
    <JwtContext.Provider value={jwtToken}>
      <userContext.Provider value={handleLogOut}>
        <Switch>
          <Route exact path='/rank/:uniq_num' component={RankPage}/>
          {/* <Route exact path='/accounts/sign_in' component={SignInPage}/> */}
          {/* <Route exact path='/accounts/sign_up' component={SignUpPage}/> */}

          <Route exact path='/' component={IndexPage}/>

          {/* <Route component={NotFound}/> */}
        </Switch>
      </userContext.Provider>
    </JwtContext.Provider>
  );
};

export {userContext}
export {JwtContext};
export default App;
